import HomePage from "./pages/HomePage";

function App() {
  return (
    <div style={{display: 'flex', flexDirection: 'column', gap: '50px'}}>

      <header>
        <h1>My App</h1>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </header>

      <main>
          <HomePage/>
      </main>


      <footer>
        &copy; 2023 My App
      </footer>

      {/* header */}
      {/* main */}
      {/* footer */}
    </div>
  );
}

export default App;
